        axios
          .post("https://synlab-carepath.herokuapp.com/upload", new FormData(formElem), { headers: headers})
          .then((response) => { 
            if (response.status == "200") {
              localStorage.setItem('synlab-name', response.data.name);
              alert('Uploaded Succesfully')
            } else {
              console.log("Unable to upload file.");
            }
          })

        .catch((error) => console.error(error.message));
      };
    return (
         <div>
             <div className="container">
             <div className="text-center pt-5 pb-5"> 
                        <h1> UPLOAD SECTION</h1>
                    </div>
                    <form onSubmit={upload} id="formElem">   
                        <input type="file" id="myFile" className="uploadform" name="pdf" /> 
                        <div className="pad-top">  
                            <input type="submit" className="btn-edit" id="btnEdit" />
                            <button type= "button" className="btn-edit" id="btnGen"> Generate Link </button>
                        </div>

                        <input type="text" className="form-edii" disabled id="genLinkUrl" />
                    </form>
             </div>
         </div> 

    )
}

export default Home
